import React from 'react'
import Loading from '../components/Loading/index'
import Grid from '@material-ui/core/Grid';

export default {
  title: 'Loading',
  component: Loading
}

export function FelixLoader() {

  return (
    <div> 
      <h3>Felix Loading Icon</h3>
      <Grid item>
        <Loading />
      </Grid>
    </div>
  )
}
